import React from "react";

function Navigation({ loggedIn }) {
  return (
    <div className="navigation" >
      {
        loggedIn ?
          (<>
            <div className="navigation__left">
              <button className="navigation__button button">Фильмы</button>
              <button className="navigation__button button">Сохраненные фильмы</button>
            </div>
            <div className="navigation__right">
              <button className="navigation__button button">Аккаунт</button>
            </div >
          </>
          )
          :
          (<>
            <div className="navigation__left"></div>
            <div className="navigation__right">
              <button className="navigation__button button">Регистрация</button>
              <button className="navigation__button button button_active">Войти</button>
            </div >
          </>
          )
      }
    </div>
  )
}

export default Navigation;
